export const CHECK_EATING:string =' CHECK_EATING';
export const CHECK_CODING:string =' CHECK_CODING';
export const CHECK_SLEEPING:string =' CHECK_SLEEPING';

export interface ActionType {
    type:string;
}

export const checkEating = () :ActionType=>{
    return {
        type:CHECK_EATING
    }
};
export const checkCoding = () :ActionType=>{
    return {
        type:CHECK_CODING
    }
};
export const checkSleeping = () :ActionType=>{
    return {
        type:CHECK_SLEEPING
    }
};
